CREATE TABLE `teams` (
  `team_id` int NOT NULL,
  `name` text,
  `founded_year` bigint DEFAULT NULL,
  `stadium_id` int DEFAULT NULL,
  `league_id` int DEFAULT NULL,
  `coach_id` int DEFAULT NULL,
